import Footer from "../components/Footer/Footer";
import { Outlet } from 'react-router-dom';

const MainLayout =()=>{
    return(
        <div>
            <Header/>
            <div className="flex flex-1">
                <main className="flex-1 p-4">
                    <Outlet/>
                </main>
            </div>
            <Footer/>
        </div>
        
    );
};
export default MainLayout;
